      <div classNameName="col-lg-6">
        <h1 classNameName="h1 pt-5 mt-5">MS Dhoni Indian cricketer</h1>

        <h5 classNameName="bg-success p-2 mt-3 w-75 text-center">Mahendra Singh Dhoni is an Indian former professional cricketer </h5>
      </div>

       <div classNameName="col-lg-6">
           <img src={pro} classNameName="w-75 mx auto img-thumbnail"/>
       </div>
    </div>

</>
  )
